  elif err == 422:
    SyntaxError
  elif err == 507:
    DiskFullError
  elif err == 429:
    BusyError
  elif err == 403 or err == 401 or err == 407 or err == 405 or err == 406:
    PermissionDenied
  elif err == 408 or err == 504:
    TimeoutError
  elif err == 508:
    DeadlockError
  elif err == 400 or err == 415:
