  of Success: 200
  of Failure: 500
  of RangeError: 416
  of SyntaxError: 422
  of DiskFullError: 507
  of BusyError: 429
  of PermissionDenied: 403
  of TimeoutError: 408
  of DeadlockError: 508
  of BadOperation: 400
  of UnimplementedOperation: 501
  of NameTooLong: 414
  of NameNotFound: 404
  of ContentTooLong: 413
  of BadLink: 421
